import React, { Component } from "react";

export class Form extends Component {
  state = {
    misison: "",
    goal: "",
    outcome: ""
  };

  onChange = e =>
    this.setState({
      [e.target.mission]: e.target.value
    });
  onSubmit = e => {
    e.preventDefault();
    console.log("submit");
  };
  render() {
    const { mission, goal, outcome } = this.state;
    return (
      <div>
        <h1>Add Vision</h1>
        <form onSubmit={this.onSubmit}>
          <div className="form-group">
            <label>misison</label>
            <input
              className="form-control"
              type="text"
              name="mission"
              onChange={this.onChange}
              value={misison}
            ></input>
          </div>
          <div className="form-group">
            <label>goal</label>
            <input
              className="form-control"
              type="text"
              name="goal"
              onChange={this.onChange}
              value={goal}
            ></input>
          </div>
          <div className="form-group">
            <label>outcome</label>
            <input
              className="form-control"
              type="text"
              name="outcome"
              onChange={this.onChange}
              value={outcome}
            ></input>
          </div>
          <div className="form-group">
            <button type="submit" className="btn btn-primary">
              Submit
            </button>
          </div>
        </form>
      </div>
    );
  }
}

export default Form;
